CREATE EXTERNAL TABLE IF NOT EXISTS default.fire (address STRING, type STRING, datetime STRING, hour STRING, latitude STRING, longitude STRING, incident_number STRING)
Partitioned By(partition_dt STRING)
Clustered By(hour) into 24 buckets
STORED AS PARQUET
Location '${absolute.hdfs.path:substringBeforeLast('/')}';
MSCK Repair Table default.fire;

